import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { useEffect, useRef } from 'react';
import { updateSampleSection } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar } from '@syncfusion/ej2-react-documenteditor';
import { ContextMenu, MenuEventArgs, MenuItemModel, ContextMenuModel } from '@syncfusion/ej2-navigations';
import { TitleBar } from './title-bar';
import './default.component.css';
DocumentEditorContainerComponent.Inject(Toolbar);
// tslint:disable:max-line-length
const CustomContextMenuView = () => {
    useEffect(() => {
        updateSampleSection();
        rendereComplete();
    }, [])
    let hostUrl: string =
        "https://services.syncfusion.com/react/production/api/documenteditor/";
    let container = useRef<DocumentEditorContainerComponent>(null);
    let titleBar: TitleBar;
    const rendereComplete = (): void => {
        window.onbeforeunload = () => {
            return "Want to save your changes?";
        };
        container.current.documentEditor.pageOutline = "#E0E0E0";
        container.current.documentEditor.acceptTab = true;
        container.current.documentEditor.resize();
        titleBar = new TitleBar(
            document.getElementById("documenteditor_titlebar"),
            container.current.documentEditor,
            true
        );
        // custom Options Functionality
        const handleCustomMenuId = (item: string): void => {
            let id: string = container.current.documentEditor.element.id;
            switch (item) {
                case id + "search_in_google":
                    let searchContent: string =
                        container.current.documentEditor.selection.text;
                    if (
                        !container.current.documentEditor.selection.isEmpty &&
                        /\S/.test(searchContent)
                    ) {
                        window.open("http://google.com/search?q=" + searchContent);
                    }
                    break;
            }
        };
        const onLoadDefault = (): void => {
            // tslint:disable
            let defaultDocument: object = {
                sfdt: "",
            };
            // tslint:enable
            container.current.documentEditor.open(JSON.stringify(defaultDocument));
            container.current.documentEditor.documentName = "Custom Context Menu";
            container.current.documentEditorSettings.showRuler = true;
            titleBar.updateDocumentTitle();
            container.current.documentChange = (): void => {
                titleBar.updateDocumentTitle();
                container.current.documentEditor.focusIn();
            };
        };
        onLoadDefault();
        // creating Custom Options
        let menuItems: MenuItemModel[] = [
            {
                text: "Search In Google",
                id: "search_in_google",
                iconCss: "e-icons e-de-ctnr-find",
            },
        ];
        // adding Custom Options
        container.current.documentEditor.contextMenu.addCustomMenu(
            menuItems,
            false
        );
        // custom Options Select Event
        container.current.documentEditor.customContextMenuSelect = (
            args: any
        ): void => {
            let item: any = args.id;
            handleCustomMenuId(item);
        };
        container.current.documentEditor.customContextMenuBeforeOpen = (
            args: any
        ): void => {
            let search: any = document.getElementById(args.ids[0]);
            search.style.display = "none";
            let searchContent: string =
                container.current.documentEditor.selection.text;
            if (
                !container.current.documentEditor.selection.isEmpty &&
                /\S/.test(searchContent)
            ) {
                search.style.display = "block";
            }
        };
    };
    return (
        <div className="control-pane">
            <div className="control-section">
                <div id="documenteditor_titlebar" className="e-de-ctn-title"></div>
                <div id="documenteditor_container_body">
                    <DocumentEditorContainerComponent
                        id="container"
                        ref={container}
                        style={{ display: "block" }}
                        height={"590px"}
                        serviceUrl={hostUrl}
                        enableToolbar={true}
                        locale="en-US"
                    />
                </div>
            </div>
            <div id="action-description">
                <p>
                    This example demonstrates how to add custom option in context menu and
                    some customization for context menu.
                </p>
            </div>
            <div id="description">
                <p>
                    In this example, custom options added to search the selected text in
                    google. The custom options will be visible after selecting the text.
                </p>
                <p style={{ display: "block" }}>Context Menu Customization Features</p>
                <ul>
                    <li>
                        Hide existing menu item and show custom menu item alone. It will be
                        achieved by passing boolean value in second parameter of
                        addCustomMenu() method
                    </li>
                    <li>
                        Show the custom menu item in bottom of the exisiting item. It will
                        be achieved by passing boolean value in third parameter of
                        addCustomMenu() method
                    </li>
                    <li>
                        Customize visibility of the added custom menu item. It will be
                        achieved using the customContextMenuBeforeOpen Event
                    </li>
                    <li>
                        Custom Option Functionality achieved by using the
                        customContextMenuSelect Event
                    </li>
                </ul>
                <p style={{ display: "block" }}>
                    {" "}
                    More information about the document editor features can be found in
                    this{" "}
                    <a
                        target="_blank"
                        href="https://ej2.syncfusion.com/react/documentation/document-editor/getting-started/"
                    >
                        documentation section.
                    </a>
                </p>
            </div>
        </div>
    );
}
export default CustomContextMenuView;
